import * as React from 'react';
import { ChartContainer, BarPlot } from '@mui/x-charts';
const uData = [4000, 3000, 2000, 2780, 1890, 2390, 3490,2000,6000,9000,2500,3000];
const xLabels = [
  'Jan',
  'Feb',
  'March',
  'April',
  'May',
  'June',
  'July',
  'Aug',
  'Sept',
  'Oct',
  'Nov',
  'Dec'
];

export default function TinyBarChart() {
  return (
    <ChartContainer
      width={700}
      height={500}
      series={[{ data: uData, label: 'months', type: 'bar' }]}
      xAxis={[{ scaleType: 'band', data: xLabels }]}
    >
      <BarPlot />
    </ChartContainer>
  );
}
